CREATE OR REPLACE VIEW VES.VIEW_SV_CAMPANHA2 AS SELECT * FROM VES.SV_CAMPANHA2;

CREATE OR REPLACE VIEW VES.VIEW_SV_CAMPANHA_CURSO AS
SELECT
    cm.COD_VEST,
    cm.COD_CURS,
    cm.SIT_CADA,
    cm.ID,
    cm.TX_DESC,
    cm.VL_MATRIC,
    cm.DATA_CAD,
    cm.NOME_USU_CAD,
    cm.DATA_MOD,
    cm.NOME_USU_MOD,
    cm.TX_DESC_SEG,
    cr.DES_CURS,
    cr.COD_GRUP,
    cr.INS_SIST,
    cr.CUR_SIST,
    cr.HAB_SIST,
    cr.PER_SIST,
    cr.LIB_VAGA,
    cr.VER_APTD,
    cr.PER_APRO,
    cr.CURS_BLO,
    cr.CURS_BOL,
    cr.VAL_INSC,
    cr.TXD_CONV,
    cr.CONS_VAL,
    cr.TXD_PGANT,
    cr.QTD_VAGA,
    cr.SIT_CUR,
    cr.ID_CADCUR
FROM VES.SV_CAMPCUR cm
         JOIN VES.SV_CADCUR cr
              ON cm.COD_CURS = cr.COD_CURS
WHERE EXISTS (
    SELECT 1 FROM VES.SV_CAMPANHA2 c
    WHERE c.COD_CAMP = cm.COD_CAMP
);

CREATE OR REPLACE VIEW VES.VIEW_SV_CAMPANHA_CUPOM AS
SELECT c.COD_CAMP, c.DESCRICA, c.TIPO_ENS, c.TXD_MATR, c.TXD_MATR_PS, c.VAL_MATR, c.VAL_MATR_PS,
       c.DTA_IVAL, c.DTA_FVAL, c.INC_EX_ALUN, c.INC_BOL_PAG, c.TXD_MEND, c.TXD_MENN, c.TXD_MENS_PS,
       c.OBSERVAC, c.ANO_VEST, c.SEM_VEST, c.TIP_CAMP, c.TIP_DESC, c.COD_SDES, c.DSC_FIN_CUR,
       c.COD_AREA, c.NOME_USU, c.TX_DESC_AC, c.TOT_PARC_AC, c.AREA_ALUN, c.ALUN_CAL, c.COD_CAMP_INSTEXT,
       c.ID_SV_CAMPANHA2, c.PRG_PAR_CUR, c.TOTAL_PARC_PC,
       cp.ID_CUPOM, cp.NOME_USU AS NOME_USU_CUPOM, cp.DATA_CAD
FROM VES.SV_CAMPANHA2 c
         JOIN VES.SV_CAMCUPOM cp ON c.COD_CAMP = cp.COD_CAMP;

CREATE OR REPLACE VIEW VES.VIEW_SV_CAMPETP AS
SELECT
    T.ID_CAMPETP,
    T.COD_CAMP,
    T.COD_VEST,
    T.SEQ_VEST,
    T.DTI_APROV,
    T.DTF_APROV,
    T.SIT_CADA,
    ST.COD_TIPO -- Novo campo
FROM VES.SV_CAMPETP T
         JOIN VES.SV_CAMPANHA2 C
              ON T.COD_CAMP = C.COD_CAMP
         JOIN VES.SV_PSELET SP
              ON SP.COD_VEST = T.COD_VEST
         JOIN VES.SV_ETAPA2 SE
              ON SE.SEQ_VEST  = T.SEQ_VEST AND
                 SE.COD_VEST = T.COD_VEST
         JOIN VES.SV_TIPVES ST
              ON ST.COD_TIPO = SE.COD_TIPO
WHERE SP.SIT_INSCR = 1;

CREATE OR REPLACE VIEW VES.VIEW_SV_COTA_CAMP AS
SELECT T.ID_SV_COTA_CAMP,
       T.COD_CAMP,
       T.ANO_VEST,
       T.SEM_VEST,
       T.QTDE_COTAS,
       T.OBSERVAC,
       T.DATA_CAD,
       T.NOME_USU,
       T.SIT_PARAM
FROM VES.SV_COTA_CAMP T
         JOIN VES.SV_CAMPANHA2 C
              ON T.COD_CAMP = C.COD_CAMP;

CREATE OR REPLACE VIEW VES.VIEW_SV_CAMPOL AS
SELECT T.ID_POLO,
       T.COD_VEST,
       T.COD_CURS,
       T.COD_CAMP,
       T.SIT_CADA
FROM VES.SV_CAMPOL T
         JOIN VES.SV_CAMPANHA2 C
              ON T.COD_CAMP = C.COD_CAMP;



